import React, { useState } from 'react';
import { Button, Drawer } from 'antd';
import './Popup.css'

const Popup = (props) => {
  return (
    <>
      <Drawer className='contact-drawer' title="Contact" placement="right" onClose={props.onClose} open={props.open}>
        <p>Some contents...</p>
        <p>Some contents...</p>
        <p>Some contents...</p>
      </Drawer>
    </>
  );
};
export default Popup;
